import { Link } from "react-router-dom";
const EVENTS = [
  {
    id: "1",
    title: "someEvent",
  },
  {
    id: "2",
    title: "someother event",
  },
];

export default function EventsPage() {
  return (
    <>
    <h1>Events Page</h1>
    {EVENTS.map(event => <li key={event.id}>

      <Link to={event.id}></Link>  //convert to relative link

    </li> )}
    </>



  )
}
